import React from 'react';

const Login = () => {
  const handleSubmit = () => {
    console.log('You hit submit. Congrats.');
  };
  return (
    <div>
      <h2>Login:</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Username:
          <input type='text' />
        </label>
        <label>
          Password:
          <input type='password' />
        </label>
        <input type='submit' />
      </form>
    </div>
  );
};

export default Login;
